// src/pages/CadastroPacienteAdmin.js
import React, { useState } from 'react';
import '../styles/CadastroPacienteAdmin.css'; 
import { useNavigate } from 'react-router-dom';

function CadastroPacienteAdmin() {
    const navigate = useNavigate();

    const [nome, setNome] = useState('');
    const [cpf, setCpf] = useState('');
    const [dataNascimento, setDataNascimento] = useState('');
    const [email, setEmail] = useState('');

    const handleSubmit = (e) => {
        e.preventDefault();
        const paciente = { nome, cpf, dataNascimento, email };
        
        console.log("Paciente cadastrado:", paciente);
        navigate('/admin/dashboard');
    };

    // Função para formatar data no formato MM/DD/AAAA
    const handleDateChange = (e) => {
        let date = e.target.value.replace(/\D/g, '');
        if (date.length > 4) date = `${date.slice(0, 2)}/${date.slice(2, 4)}/${date.slice(4, 8)}`;
        setDataNascimento(date);
    };

    return (
        <div className="cadastro-paciente-container">
            <h2>Cadastro de Paciente</h2>
            <form onSubmit={handleSubmit} className="form-cadastro-paciente">
                <div className="form-group">
                    <label>Nome Completo</label>
                    <input 
                        type="text" 
                        className="form-control" 
                        value={nome} 
                        onChange={(e) => setNome(e.target.value)} 
                        required 
                    />
                </div>

                <div className="form-group">
                    <label>CPF</label>
                    <input 
                        type="text" 
                        className="form-control" 
                        value={cpf} 
                        onChange={(e) => setCpf(e.target.value)} 
                        required 
                    />
                </div>

                <div className="form-group">
                    <label>Data de Nascimento (MM/DD/AAAA)</label>
                    <input 
                        type="text" 
                        className="form-control" 
                        value={dataNascimento} 
                        onChange={handleDateChange} 
                        maxLength="10" 
                        placeholder="MM/DD/AAAA" 
                        required 
                    />
                </div>

                <div className="form-group">
                    <label>Email</label>
                    <input 
                        type="email" 
                        className="form-control" 
                        value={email} 
                        onChange={(e) => setEmail(e.target.value)} 
                        required 
                    />
                </div>

                <div className="button-group">
                    <button type="submit" className="btn btn-primary">Cadastrar Paciente</button>
                    <button 
                        type="button" 
                        className="btn btn-outline-secondary" 
                        onClick={() => navigate('/admin/dashboard')}
                    >
                        Cancelar
                    </button>
                </div>
            </form>
        </div>
    );
}

export default CadastroPacienteAdmin;
